Pictured is the beautiful Hiraoka Tree Art Center in Sapporo, Japan. If you're planning a trip to Japan in the fall, be sure to save this post, as this location is an absolute must-see.
â€¢
Other than western and Japanese gardens, the park is home to the iconic, crimson red Japanese Maple Tree (Momiji ç´…è‘‰). As pictured, these blooming trees are incredibly beautiful and vibrant in color. 
